  demotionProblemEmailWarningBody: "<p>Estimado %(user_name):</p><p>El acceso a tu problema %(problem_name) en omegaup.com ha sido marcado con una advertencia debido a que ha sido reportado por los usuarios. El equipo de omegaUp revis\u00f3 este reporte y confirm\u00f3 que el problema tiene aspectos mejorables debido a que %(reason).</p><p>Para retirar la notificaci\u00f3n de advertencia del problema y que vuelva a mostrarse de manera normal, por favor sigue los siguientes pasos:</p><p><ol><li>Revisa y edita tu problema.</li><li>Una vez que hayas resuelto la raz\u00f3n por la que tu problema fue marcado con una advertencia, manda un email a quality@omegaup.com para que sea revisado.</li></lo></p><p>De no seguirse los pasos mencionados arriba, el problema mostrar\u00e1 una advertencia a todos los usuarios que intenten resolverlo y/o verlo.</p><p>omegaUp es una plataforma para ayudar a los usuarios a mejorar sus habilidades en ingenier\u00eda de software resolviendo problemas de c\u00f3digo y compitiendo en concursos de programaci\u00f3n. omegaUp da la bienvenida a todos los problemas que ayuden a cumplir esa meta.</p><p>Gracias,</p><p>Equipo omegaUp</p>",
